export class Worksheet {
  constructor(id, description, start, end, costHour, total, billingType, userType, user, event, product) {
    this.id = id;
    this.description = description;
    this.start = start;
    this.end = end;
    this.costHour = costHour;
    this.total = total;
    this.billingType = billingType;
    this.userType = userType;
    this.user = user;
    this.event = event;
    this.product = product;
  }
}
export function getWorksheetIdentifier(worksheet) {
  return worksheet.id;
}
